tables.table_schema:
CREATE TABLE collaborators (
  collaborator_id SERIAL PRIMARY KEY,
  project_id INT,
  collaborator_name TEXT,
  role TEXT
);

CREATE TABLE expenses (
    expense_id INT PRIMARY KEY,
    project_id INT,
    description TEXT,
    amount DECIMAL
);

CREATE TABLE projects (
    project_id INT PRIMARY KEY,
    project_name TEXT,
    start_date DATE,
    end_date DATE
);

CREATE TABLE collaborators (
    collaborator_id INT PRIMARY KEY,
    collaborator_name TEXT,
    email TEXT,
    phone_number TEXT
);

CREATE TABLE project_expenses (
    project_id INT,
    expense_id INT,
    FOREIGN KEY (project_id) REFERENCES projects (project_id),
    FOREIGN KEY (expense_id) REFERENCES expenses (expense_id)
);

CREATE TABLE collaborators (
  collaborator_id SERIAL PRIMARY KEY,
  project_id INT,
  collaborator_name VARCHAR(255),
  collaborator_email VARCHAR(255)
);

CREATE TABLE project_expenses (
  expense_id INT,
  project_id INT,
  FOREIGN KEY (expense_id) REFERENCES expenses(expense_id),
  FOREIGN KEY (project_id) REFERENCES projects(project_id)
);
